// pages/Calls.jsx
import React, { useState, useEffect } from 'react';
import {
  Box,
  Paper,
  Typography,
  Grid,
  Card,
  CardContent,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TextField,
  Button,
  Tabs,
  Tab,
  Chip,
  CircularProgress,
  Alert,
} from '@mui/material';
import {
  Phone,
  CheckCircle,
  Cancel,
  Schedule,
  Person,
  PlayArrow,
  GetApp,
} from '@mui/icons-material';
import { callsAPI, recordingsAPI } from '../services/api';

const Calls = () => {
  const [tabValue, setTabValue] = useState(0);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Fechas - usar hasta ayer para incluir datos recientes
  const yesterday = new Date(Date.now() - 24 * 60 * 60 * 1000).toISOString().split('T')[0];
  const weekAgo = new Date(Date.now() - 7 * 24 * 60 * 60 * 1000).toISOString().split('T')[0];

  const [startDate, setStartDate] = useState(weekAgo);
  const [endDate, setEndDate] = useState(yesterday);

  // Datos
  const [callsList, setCallsList] = useState([]);
  const [callsByAgent, setCallsByAgent] = useState([]);
  const [statistics, setStatistics] = useState(null);

  // Estado del reproductor de audio
  const [playingCallId, setPlayingCallId] = useState(null);

  useEffect(() => {
    loadData();
  }, [startDate, endDate]);

  const loadData = async () => {
    setLoading(true);
    setError(null);

    try {
      // Cargar datos según la pestaña activa
      if (tabValue === 0) {
        // Lista de llamadas
        const response = await callsAPI.getList(startDate, endDate, null, 50);
        setCallsList(response.data.data.calls || []);
      } else if (tabValue === 1) {
        // Llamadas por agente
        const response = await callsAPI.getByAgent(startDate, endDate);
        setCallsByAgent(response.data.data.agents || []);
      }

      // Siempre cargar estadísticas
      const statsResponse = await callsAPI.getStatistics(startDate, endDate);
      setStatistics(statsResponse.data.data);
    } catch (err) {
      console.error('Error loading calls:', err);
      setError(err.message || 'Error al cargar las llamadas');
    } finally {
      setLoading(false);
    }
  };

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'COMPLETED':
      case 'ANSWERED':
        return 'success';
      case 'ABANDONED':
        return 'error';
      case 'TIMEOUT':
      case 'EXITED_WITH_KEY':
        return 'warning';
      default:
        return 'default';
    }
  };

  const getStatusText = (status) => {
    const statusMap = {
      'COMPLETED': 'Completada',
      'ANSWERED': 'Contestada',
      'ABANDONED': 'Abandonada',
      'TIMEOUT': 'Tiempo agotado',
      'EXITED_WITH_KEY': 'Salida con tecla',
      'ENTERED': 'En cola',
      'UNKNOWN': 'Desconocido'
    };
    return statusMap[status] || status;
  };

  const handlePlayRecording = (callid, calldate) => {
    const date = calldate.split('T')[0]; // Extraer fecha YYYY-MM-DD
    const audioUrl = recordingsAPI.getStreamUrl(callid, date);

    // Si ya está reproduciendo este audio, detener
    if (playingCallId === callid) {
      setPlayingCallId(null);
    } else {
      setPlayingCallId(callid);
      // Reproducir el audio
      window.open(audioUrl, '_blank');
    }
  };

  const handleDownloadRecording = (callid, calldate) => {
    const date = calldate.split('T')[0];
    const downloadUrl = recordingsAPI.getDownloadUrl(callid, date);
    window.open(downloadUrl, '_blank');
  };

  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        Llamadas
      </Typography>

      {/* Estadísticas */}
      {statistics && (
        <Grid container spacing={3} sx={{ mb: 3 }}>
          <Grid item xs={12} sm={6} md={3}>
            <Card>
              <CardContent>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                  <Phone color="primary" sx={{ mr: 1 }} />
                  <Typography variant="h6">Total</Typography>
                </Box>
                <Typography variant="h4">{statistics.total_calls}</Typography>
                <Typography variant="body2" color="text.secondary">
                  Llamadas
                </Typography>
              </CardContent>
            </Card>
          </Grid>

          <Grid item xs={12} sm={6} md={3}>
            <Card>
              <CardContent>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                  <CheckCircle color="success" sx={{ mr: 1 }} />
                  <Typography variant="h6">Contestadas</Typography>
                </Box>
                <Typography variant="h4">{statistics.answered_calls}</Typography>
                <Typography variant="body2" color="text.secondary">
                  {statistics.answer_rate}% tasa de respuesta
                </Typography>
              </CardContent>
            </Card>
          </Grid>

          <Grid item xs={12} sm={6} md={3}>
            <Card>
              <CardContent>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                  <Cancel color="error" sx={{ mr: 1 }} />
                  <Typography variant="h6">Abandonadas</Typography>
                </Box>
                <Typography variant="h4">{statistics.abandoned_calls}</Typography>
                <Typography variant="body2" color="text.secondary">
                  Llamadas perdidas
                </Typography>
              </CardContent>
            </Card>
          </Grid>

          <Grid item xs={12} sm={6} md={3}>
            <Card>
              <CardContent>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                  <Schedule color="info" sx={{ mr: 1 }} />
                  <Typography variant="h6">Duración</Typography>
                </Box>
                <Typography variant="h4">{Math.round(statistics.avg_duration)}s</Typography>
                <Typography variant="body2" color="text.secondary">
                  Promedio de conversación
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        </Grid>
      )}

      {/* Filtros de fecha */}
      <Paper sx={{ p: 2, mb: 3 }}>
        <Grid container spacing={2} alignItems="center">
          <Grid item xs={12} sm={4}>
            <TextField
              label="Fecha inicio"
              type="date"
              value={startDate}
              onChange={(e) => setStartDate(e.target.value)}
              InputLabelProps={{ shrink: true }}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={4}>
            <TextField
              label="Fecha fin"
              type="date"
              value={endDate}
              onChange={(e) => setEndDate(e.target.value)}
              InputLabelProps={{ shrink: true }}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={4}>
            <Button
              variant="contained"
              onClick={loadData}
              fullWidth
              disabled={loading}
            >
              Buscar
            </Button>
          </Grid>
        </Grid>
      </Paper>

      {/* Error */}
      {error && (
        <Alert severity="error" sx={{ mb: 3 }}>
          {error}
        </Alert>
      )}

      {/* Tabs */}
      <Paper sx={{ mb: 3 }}>
        <Tabs value={tabValue} onChange={handleTabChange}>
          <Tab label="Lista de Llamadas" />
          <Tab label="Por Agente" />
        </Tabs>
      </Paper>

      {/* Contenido de tabs */}
      {loading ? (
        <Box sx={{ display: 'flex', justifyContent: 'center', p: 5 }}>
          <CircularProgress />
        </Box>
      ) : (
        <>
          {/* Tab 0: Lista de llamadas */}
          {tabValue === 0 && (
            <TableContainer component={Paper}>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell>Fecha/Hora</TableCell>
                    <TableCell>Número</TableCell>
                    <TableCell>Call ID</TableCell>
                    <TableCell>Cola</TableCell>
                    <TableCell>Agente</TableCell>
                    <TableCell>Estado</TableCell>
                    <TableCell align="right">Espera</TableCell>
                    <TableCell align="right">Conversación</TableCell>
                    <TableCell align="right">Total</TableCell>
                    <TableCell align="center">Grabación</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {callsList.map((call, index) => (
                    <TableRow key={`${call.callid}-${index}`}>
                      <TableCell>
                        {new Date(call.calldate).toLocaleString('es-ES', {
                          year: 'numeric',
                          month: '2-digit',
                          day: '2-digit',
                          hour: '2-digit',
                          minute: '2-digit'
                        })}
                      </TableCell>
                      <TableCell>
                        <Box sx={{ display: 'flex', alignItems: 'center' }}>
                          <Phone fontSize="small" sx={{ mr: 0.5, color: 'primary.main' }} />
                          <strong>{call.phone_number !== 'N/A' ? call.phone_number : '-'}</strong>
                        </Box>
                      </TableCell>
                      <TableCell sx={{ fontFamily: 'monospace', fontSize: '0.85em' }}>
                        {call.callid.split('.')[0].substring(call.callid.length - 8)}
                      </TableCell>
                      <TableCell>{call.queuename}</TableCell>
                      <TableCell>
                        {call.agent !== 'N/A' ? (
                          <Box sx={{ display: 'flex', alignItems: 'center' }}>
                            <Person fontSize="small" sx={{ mr: 0.5 }} />
                            {call.agent}
                          </Box>
                        ) : (
                          '-'
                        )}
                      </TableCell>
                      <TableCell>
                        <Chip
                          label={getStatusText(call.status)}
                          color={getStatusColor(call.status)}
                          size="small"
                        />
                      </TableCell>
                      <TableCell align="right">{call.wait_time_formatted}</TableCell>
                      <TableCell align="right">{call.talk_time_formatted}</TableCell>
                      <TableCell align="right">{call.total_time_formatted}</TableCell>
                      <TableCell align="center">
                        <Box sx={{ display: 'flex', gap: 0.5, justifyContent: 'center' }}>
                          <Button
                            size="small"
                            variant="outlined"
                            color="primary"
                            startIcon={<PlayArrow />}
                            onClick={() => handlePlayRecording(call.callid, call.calldate)}
                            title="Reproducir grabación"
                          >
                            Play
                          </Button>
                          <Button
                            size="small"
                            variant="outlined"
                            color="secondary"
                            onClick={() => handleDownloadRecording(call.callid, call.calldate)}
                            title="Descargar grabación"
                          >
                            <GetApp />
                          </Button>
                        </Box>
                      </TableCell>
                    </TableRow>
                  ))}
                  {callsList.length === 0 && (
                    <TableRow>
                      <TableCell colSpan={10} align="center">
                        No hay llamadas en el rango de fechas seleccionado
                      </TableCell>
                    </TableRow>
                  )}
                </TableBody>
              </Table>
            </TableContainer>
          )}

          {/* Tab 1: Por agente */}
          {tabValue === 1 && (
            <Grid container spacing={3}>
              {callsByAgent.map((agentData) => (
                <Grid item xs={12} key={agentData.agent}>
                  <Paper sx={{ p: 3 }}>
                    <Typography variant="h6" gutterBottom>
                      <Person sx={{ verticalAlign: 'middle', mr: 1 }} />
                      {agentData.agent} - {agentData.agent_full}
                    </Typography>

                    <Grid container spacing={2} sx={{ mb: 2 }}>
                      <Grid item xs={6} sm={3}>
                        <Typography variant="body2" color="text.secondary">
                          Total Llamadas
                        </Typography>
                        <Typography variant="h6">
                          {agentData.total_calls}
                        </Typography>
                      </Grid>
                      <Grid item xs={6} sm={3}>
                        <Typography variant="body2" color="text.secondary">
                          Completadas
                        </Typography>
                        <Typography variant="h6">
                          {agentData.completed_calls}
                        </Typography>
                      </Grid>
                      <Grid item xs={6} sm={3}>
                        <Typography variant="body2" color="text.secondary">
                          Tiempo Total
                        </Typography>
                        <Typography variant="h6">
                          {agentData.total_talk_time_formatted}
                        </Typography>
                      </Grid>
                      <Grid item xs={6} sm={3}>
                        <Typography variant="body2" color="text.secondary">
                          Promedio Conversación
                        </Typography>
                        <Typography variant="h6">
                          {Math.round(agentData.avg_talk_time)}s
                        </Typography>
                      </Grid>
                    </Grid>

                    <TableContainer>
                      <Table size="small">
                        <TableHead>
                          <TableRow>
                            <TableCell>Fecha/Hora</TableCell>
                            <TableCell>Call ID</TableCell>
                            <TableCell>Cola</TableCell>
                            <TableCell>Evento</TableCell>
                            <TableCell align="right">Espera</TableCell>
                            <TableCell align="right">Conversación</TableCell>
                          </TableRow>
                        </TableHead>
                        <TableBody>
                          {agentData.calls.slice(0, 10).map((call, index) => (
                            <TableRow key={`${call.callid}-${call.event}-${index}`}>
                              <TableCell>
                                {new Date(call.time).toLocaleString('es-ES', {
                                  month: '2-digit',
                                  day: '2-digit',
                                  hour: '2-digit',
                                  minute: '2-digit'
                                })}
                              </TableCell>
                              <TableCell sx={{ fontFamily: 'monospace', fontSize: '0.75em' }}>
                                ...{call.callid.substring(call.callid.length - 8)}
                              </TableCell>
                              <TableCell>{call.queuename}</TableCell>
                              <TableCell>
                                <Chip label={call.event} size="small" variant="outlined" />
                              </TableCell>
                              <TableCell align="right">{call.wait_time_formatted}</TableCell>
                              <TableCell align="right">{call.talk_time_formatted}</TableCell>
                            </TableRow>
                          ))}
                        </TableBody>
                      </Table>
                    </TableContainer>
                    {agentData.calls.length > 10 && (
                      <Typography variant="body2" color="text.secondary" sx={{ mt: 1, textAlign: 'center' }}>
                        Mostrando 10 de {agentData.calls.length} llamadas
                      </Typography>
                    )}
                  </Paper>
                </Grid>
              ))}
              {callsByAgent.length === 0 && (
                <Grid item xs={12}>
                  <Paper sx={{ p: 3, textAlign: 'center' }}>
                    <Typography color="text.secondary">
                      No hay datos de agentes en el rango de fechas seleccionado
                    </Typography>
                  </Paper>
                </Grid>
              )}
            </Grid>
          )}
        </>
      )}
    </Box>
  );
};

export default Calls;
